// SPDX-License-Identifier: MIT

pragma solidity ^0.8.8;

contract constants{
    // jab kisi variable ka value change n karna ho to constant keyword ka use karte hai
    // jab kisi contract ke owner ko change nahi karne ho to us case me constant keyword ka use kar sakte hai
    // jab state variable bnate hai to uska gast cost jyada hota hai usi gas cost ko kam karne aur efficiency ko badhane ke liye constant keyword ka use karte hai
    address public constant owneradd = 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4;
    address public owneradd2 = 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4;
    
}

